package com.izeno.backendapi.usecase;

import com.fasterxml.jackson.core.JsonProcessingException;
import com.fasterxml.jackson.databind.ObjectMapper;
import com.izeno.backendapi.config.RestTemplateConfig;
import com.izeno.backendapi.entity.SubmitMockRequest;
import com.izeno.backendapi.entity.SubmitMockResponse;
import com.izeno.backendapi.entity.SubmitMockRequest.Documents;

import lombok.extern.slf4j.Slf4j;

import java.util.ArrayList;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.http.HttpEntity;
import org.springframework.http.HttpHeaders;
import org.springframework.http.HttpMethod;
import org.springframework.http.MediaType;
import org.springframework.http.ResponseEntity;
import org.springframework.stereotype.Service;

@Service
@Slf4j
public class SubmitToMock {
    @Autowired
    RestTemplateConfig restTemplate;

    @Autowired
    ObjectMapper objectMapper;

    public SubmitMockResponse testMock() throws JsonProcessingException {
        //Initiate mock test data
        SubmitMockRequest request = new SubmitMockRequest();

        java.util.List<Documents> documents = new ArrayList<>();
        //doc-1
        SubmitMockRequest.Documents doc1 = new SubmitMockRequest.Documents();
        doc1.setFormat("JSON");
        doc1.setDocument("");
        doc1.setDocumentHash("Base64");
        doc1.setCodeNumber("INV202404020001");
        documents.add(doc1);

        //doc-2
        Documents doc2 = new Documents();
        
        doc2.setFormat("JSON");
        doc2.setDocument("");
        doc2.setDocumentHash("Base64");
        doc2.setCodeNumber("INV202404020002");
        documents.add(doc2);
        
        //doc-3
        Documents doc3 = new Documents();
        doc3.setFormat("JSON");
        doc3.setDocument("");
        doc3.setDocumentHash("Base64");
        doc3.setCodeNumber("INV202404020003");
        documents.add(doc3);

        request.setDocuments(documents);

        //call mock
        String responseBody = "";
        ResponseEntity<String> responseEntity;
        HttpHeaders httpHeaders = new HttpHeaders();
        httpHeaders.setContentType(MediaType.APPLICATION_JSON);

        HttpEntity<?> httpEntity = new HttpEntity<>(objectMapper.writeValueAsString(request), httpHeaders);

        try {
            responseEntity = restTemplate.restTemplate().exchange("https://api.mockfly.dev/mocks/f40d6b62-65a1-4f7f-8e57-44ce8265127f/v1/api/mock/submit", HttpMethod.POST, httpEntity, String.class);
            responseBody = responseEntity.getBody();
            log.info("responseBody: ", responseEntity);
        } catch (Exception e) {
            log.error(e.getStackTrace().toString());
        }

        SubmitMockResponse response = objectMapper.readValue(responseBody, SubmitMockResponse.class);

        return response;
    }
}
